import {
  Container,
  Navbar,
  Nav,
  NavItem
} from 'react-bootstrap';




function Header(){
  return(
<nav class="navbar navbar-inverse" data-reactid=".0"><div class="container-fluid" data-reactid=".0.0"><div class="navbar-header" data-reactid=".0.0.0"><button type="button" class="navbar-toggle collapsed" data-toggle="collapse" data-target="#navbar-collapse" aria-expanded="false" data-reactid=".0.0.0.0"><span class="sr-only" data-reactid=".0.0.0.0.0">Toggle navigation</span><span class="icon-bar" data-reactid=".0.0.0.0.1"></span><span class="icon-bar" data-reactid=".0.0.0.0.2"></span><span class="icon-bar" data-reactid=".0.0.0.0.3"></span></button><a class="navbar-brand" href="#" data-reactid=".0.0.0.1">React Bootstrap Navbar</a></div><div class="collapse navbar-collapse" id="navbar-collapse" data-reactid=".0.0.1"><ul class="nav navbar-nav" data-reactid=".0.0.1.0"><li class="" data-reactid=".0.0.1.0.0"><a href="#" data-reactid=".0.0.1.0.0.0">Link 1</a></li><li class="" data-reactid=".0.0.1.0.1"><a href="#" data-reactid=".0.0.1.0.1.0">Link 2</a></li><li class="dropdown active" data-reactid=".0.0.1.0.2"><a href="#" class="dropdown-toggle" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false" data-reactid=".0.0.1.0.2.0"><span data-reactid=".0.0.1.0.2.0.0">Dropdown</span><span class="caret" data-reactid=".0.0.1.0.2.0.1"></span></a><ul class="dropdown-menu" data-reactid=".0.0.1.0.2.1"><li class="" data-reactid=".0.0.1.0.2.1.0"><a href="#" data-reactid=".0.0.1.0.2.1.0.0">Dropdown Link 1</a></li><li class="active" data-reactid=".0.0.1.0.2.1.1"><a href="#" data-reactid=".0.0.1.0.2.1.1.0">Dropdown Link 2</a></li></ul></li></ul></div></div></nav>
  )
}

export default Header;
